        \"6098c96a-8f3a-a74c-d26c-95156a35605f\",\r\n          \"Text\": \"<font size=\\\"3\\\">\\n<u>Emotional
        abuse</u> includes undermining a person's sense of self-worth through constant
        criticism; belittling one's abilities; name-calling or other verbal abuse;
        damaging a partner's relationship with the children; or not letting a partner
        see friends and family. You may be in an emotionally abusive relationship
        if your partner:\\n<br><br>\\n<u>Psychological abuse</u> is causing fear by
        intimidation; threatening physical harm to self, partner or children; destruction
        of pets and property; \u201Cmind games\u201D; or forcing isolation from friends,
        family, school and/or work.\\nFinancial or economic abuse is making or attempting
        to make a person financially dependent by maintaining total control over financial
        resources, withholding access to money, and/or forbidding attendance at school
        or employment.\\n<br><br>\\n<u>Physical abuse</u> is when a person hurts or
        tries to hurt a partner by hitting, kicking, burning, grabbing, pinching,
        shoving, slapping, hair-pulling, biting, denying medical care or forcing alcohol
        and/or drug use, or using other physical force. You may be in a physically
        abusive relationship if your partner:\\n<br><br>\\n<u>Sexual abuse</u> is
        forcing a partner to take part in a sex act when the partner does not consent.
        You may be in a sexually abusive relationship if your partner:\\n<br><br>\\n<u>Stalking</u>
