        \         \"Text\": \"<u>Arthritis</u> swelling and pain in the joints\\n<br><br>\\n<u>Asthma</u>
        a condition that causes problems getting air in and out of the lungs\\n<br><br>\\n<u>Diabetes</u>
        - a disease that causes you to have high amounts of sugar in the blood\\n<br><br>\\n<u>Cholesterol</u>
        is a type of fat that can block blood vessels\\n<br><br>\\n<u>AIDS</u> is
        a chronic, potentially life-threatening condition caused by the human immunodeficiency
        virus (HIV). By damaging your immune system, HIV interferes with your body's
        ability to fight the organisms that cause disease.\\n<br><br>\\n<u>Heart disease</u>
        is a broad term used to describe a range of diseases that affect your heart.
        The various diseases that fall under the umbrella of heart disease include
        diseases of your blood vessels, such as coronary artery disease; heart rhythm
        problems (arrhythmias); heart infections; and heart defects you're born with
        (congenital heart defects).\\n\\n<u>Melanoma</u> is a form of cancer that
        starts in a certain type of skin cell called a melanocyte.\\n<br><br>\\n<u>Malaria</u>
        is an infectious disease characterized by cycles of chills, fever, and sweating,
        caused by a protozoan of the genus Plasmodium in red blood cells. The parasite
        is transmitted by infected mosquitoes in many tropical and subtropical regions.
        \\n<br><br>\\n<u>Hepatitis A</u> is an acute infectious disease of the liver
        caused by the hepatitis A virus (HAV), usually spread by ingestion of contaminated
        food or water or through direct contact with an infectious person.\\n<br><br>\\n<u>Hepatitis
        B</u> is an infection of the liver that is caused by the hepatitis B virus,
        transmitted by contaminated blood or blood derivatives in transfusions, by
        sexual contact with an infected person, or by the use of contaminated needles
        and instruments. Also called serum hepatitis.\",\r\n          \"AttachmentName\":
