        \         \"Text\": \"<u>Yellow Fever</u> is a tropical viral disease affecting
        the liver and kidneys, causing fever and jaundice and often fatal. It is transmitted
        by mosquitoes.\\n<br><br>\\n<u>Meningitis</u> is an inflammation of the membranes
        (meninges) surrounding your brain and spinal cord.\\n<br><br>\\n<u>Typhoid</u>
        is an infectious bacterial fever with an eruption of red spots on the chest
        and abdomen and severe intestinal irritation, transmitted by the ingestion
        of contaminated food or water.\\n<br><br>\\n<u>Hepatitis A</u> is an acute
        infectious disease of the liver caused by the hepatitis A virus (HAV), usually
        spread by ingestion of contaminated food or water or through direct contact
        with an infectious person.\\n<br><br>\\n<u>Hepatitis B</u> is an infection
        of the liver that is caused by the hepatitis B virus, transmitted by contaminated
        blood or blood derivatives in transfusions, by sexual contact with an infected
        person, or by the use of contaminated needles and instruments. Also called
        serum hepatitis.\\n<br><br>\\n<u>Tetanus</u> is an acute, often fatal disease
        characterized by spasmodic contraction of voluntary muscles, especially those
        of the neck and jaw, and caused by the toxin of the bacillus Clostridium tetani,
        which typically infects the body through a deep wound.\\n<br><br>\\n<u>Polio</u>
        is a contagious viral illness that in its most severe form causes paralysis,
        difficulty breathing and sometimes death. Despite a concerted global eradication
        campaign, poliovirus continues to affect children and adults in Afghanistan,
        India, Nigeria and Pakistan.\\n<br><br>\\n<u>Rabies</u> is an infectious disease
        of dogs, cats, and other animals, transmitted to humans by the bite of an
        infected animal and usually fatal if prophylactic treatment is not administered.\",\r\n
